uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_twist;
uniform float u_thickness;
uniform float u_glow_intensity;

out vec4 fragColor;

// --- Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// --- Path Generation ---
// The "Infinity" Bowtie logic in 3D
vec3 getBowtiePos(float t) {
    float angle = t * 0.5;
    // Lemniscate of Bernoulli formula
    float scale = 8.0;
    float denom = 1.0 + pow(sin(angle), 2.0);
    float x = (scale * cos(angle)) / denom;
    float y = (scale * sin(angle) * cos(angle)) / denom;
    float z = sin(t * 0.2) * 2.0; // Slow vertical oscillation
    return vec3(x, y, z);
}

// Distance Function
float map(vec3 p) {
    float t = iTime * u_speed * 0.2;

    // We sample multiple points along the "infinity" loop to create a continuous tube
    float d = 1e10;

    // Procedural twist and weave
    float twist = p.z * u_twist + iTime;

    // To make it look like a "Bowtie", we evaluate the SDF against the infinity curve
    // For performance in a fragment shader, we approximate the curve distance
    for(float i = 0.0; i < 1.0; i += 0.1) {
        float sampleT = t + i * 6.2831;
        vec3 curvePos = getBowtiePos(sampleT);

        // Add some local variation/noise to the tube
        float localDist = length(p - curvePos);

        // Interior energy "ribbons" logic
        vec3 q = p - curvePos;
        q.xy *= rot(sampleT * 2.0 + iTime);
        float ribbon = length(q.xy) - u_thickness * (0.8 + 0.4 * sin(q.z * 5.0 + iTime * 2.0));

        d = smin(d, ribbon, 1.5);
    }

    return d;
}

// Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float globalTime = iTime * u_speed;

    // --- Parallel Rail Camera Strategy ---
    // 1. Position on the infinity loop
    vec3 pathPos = getBowtiePos(globalTime * 0.5);

    // 2. Camera Rail Offset
    // The camera orbits the current path position at u_camera_dist
    float angle = globalTime * 0.1;
    vec3 railVec = vec3(cos(angle), sin(angle), sin(angle * 0.5)) * u_camera_dist;

    vec3 ro = pathPos + railVec;

    // 3. Target (Look slightly ahead on the path)
    vec3 ta = getBowtiePos(globalTime * 0.5 + 0.5) + railVec * 0.5;

    // Camera Transform
    vec3 cw = normalize(ta - ro);
    vec3 cu = normalize(cross(cw, vec3(0, 1, 0)));
    vec3 cv = normalize(cross(cu, cw));
    vec3 rd = normalize(uv.x * cu + uv.y * cv + u_fov * cw);

    // --- Raymarching ---
    float t = 0.0;
    float d = 0.0;
    float glow = 0.0;
    vec3 col = vec3(0.0);

    for(int i = 0; i < 80; i++) {
        vec3 p = ro + rd * t;
        d = map(p);

        // Accumulate glow based on proximity to surface
        glow += 0.01 / (0.05 + d * d);

        if(d < 0.001 || t > 40.0) break;
        t += d * 0.6; // Slightly conservative step for smooth curves
    }

    // --- Shading ---
    if(d < 0.1) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 ref = reflect(rd, n);

        // Fresnel
        float fres = pow(1.0 + dot(rd, n), 3.0);

        // Base Color: Iridescent Blues/Purples
        vec3 baseCol = 0.5 + 0.5 * cos(vec3(0, 2, 4) + p.z * 0.2 + iTime);

        // Lighting
        float diff = max(dot(n, normalize(vec3(1, 2, 3))), 0.0);
        float spec = pow(max(dot(ref, normalize(vec3(1, 2, 3))), 0.0), 32.0);

        col = baseCol * diff + spec + fres * baseCol;

        // Add "Energy Weave" texture
        vec3 tex = texture(iChannel0, p.xz * 0.1 + iTime * 0.05).rgb;
        col += tex * 0.2;
    }

    // Volumetric Atmosphere
    vec3 glowCol = 0.5 + 0.5 * cos(vec3(1, 3, 5) + globalTime * 0.3);
    col += glow * glowCol * u_glow_intensity;

    // Background stars/dust
    float stars = pow(fract(sin(dot(rd, vec3(12.9898, 78.233, 45.164))) * 43758.5453), 20.0);
    col += stars * 0.1 * (1.0 - smoothstep(0.0, 30.0, t));

    // Tonemapping & Contrast
    col = smoothstep(0.0, 1.1, col);
    col = pow(col, vec3(0.85)); // Gamma correction-ish

    fragColor = vec4(col, 1.0);
}
